    </Container>
  );
};
const TimeLineItem = ({ icon, detail }) => {
  return (
    <>
    <div className="timeline-item">
          <div className="timeline-dot"></div>
          <div className="timeline-content">
            <h3>Título 3</h3>
            <p>Descripción del evento 3.</p>
            <a href="#" className="btn btn-primary">Descargar</a>
          </div>
        </div>
    </>
  );
};
